import React from "react";
import { useNavigate } from "react-router-dom";


function Categorypage (){
    const navigate=useNavigate()

    const seeds=()=>{
        navigate('/seedscategory')
    }
    const gotofruit = useNavigate()

    const jumptofruit=()=>{
        gotofruit('/fruitscategory')
    }
    const gotovegetables = useNavigate()

    const jumptovegetables = ()=>{
        gotovegetables('/vegetablescategory')
    }
    return (
        <div style={{border:"20px",textAlign:"center"}}>
            <img src="seeds.jpg" style={{height:"200px",width:"200px",textAlign:"center"}} onClick={seeds}></img><br/>
            <button onClick={seeds}>Seeds</button><br/>
            <img src="fruits.jpg" style={{height:"200px",width:"200px",textAlign:"center"}} ></img><br/>
            <button onClick={gotofruit}>Fruits</button><br/>
            <img src="vegetables.jpg" style={{height:"200px",width:"200px",textAlign:"center"}}></img><br/>
            <a href="">vegetables</a>
        </div>
    )
}
export default Categorypage;
